import React from "react";

function Card (props){
    return (
    <div className="card">
        <div className="top">
            <h2 className="name">{props.name}</h2>
            <img className="circle-img" src={props.pic} alt="null"/>
        </div>
        <div className="buttom">
            <p className="info">{props.tel}</p>
            <p className="info">{props.email}</p>
        </div>
    </div>);
}

export default Card;
